import {PrettyDiv, Nameh2} from "./cardStyle";
export default function Card(props) {
   return (
      <PrettyDiv>
         <button onClick={props.onClose}>X</button>
         <Nameh2>{props.name}</Nameh2>
         <Newh2>{props.status}</Newh2>
         <Newh2>{props.species}</Newh2>
         <Newh2>{props.gender}</Newh2>
         <Newh2>{props.origin}</Newh2>
         <img src={props.image} alt='' />
      </PrettyDiv>
   );
}
